def add_strzok_page_messages_from_grassley(parent_file: truxton.TruxtonChildFileIO) -> None:
  child_file = add_file(parent_file, SUPPORT_DOCUMENTS_FOLDER + "2018-01-25 CEG Letter to FBI Source Texts.pdf")
  child_file.tag("Text Messages", "More text messages Messages", truxton.TAG_ORIGIN_HUMAN)

  # OUTBOX is Page -> Strzok
  # INBOX is Strzok -> Page
  # Page 1, labelled DOJ-PROD-00000060 page 18
  m = page_to_strzok(child_file, "2016-02-23T01:50:41+05:00", "What does he think?")
  strzok_to_page(child_file, "2016-02-23T01:51:05+05:00", "It's interesting, I've got --Redacted-- and David and him and everyone calling me to survey the terrain. I guess that's good.")
  m = strzok_to_page(child_file, "2016-02-24T11:48:15+05:00", "--Redacted-- 8:30. I will arrive right about then and will be free until 910 when my midyear brief starts. --Redacted--")
  m.addnote("midyear - Midyear Exam, Clinton investigation")
  strzok_to_page(child_file, "2016-02-24T23:54:20+05:00", "Hey I know your evening sucks. I need to talk to you tonight about work. Things went sideways with Andy and Bill.\n\nAt my desk, calling --Redacted-- to see if he is still here.")
  strzok_to_page(child_file, "2016-02-24T23:57:18+05:00", "Sorry, I'm busy. Call back later.")
  page_to_strzok(child_file, "2016-02-24T23:57:51+05:00", "He is I just got off the phone with him. He told me about wrap.")
  strzok_to_page(child_file, "2016-02-24T23:59:51+05:00", "I'm talking to him now.")
  page_to_strzok(child_file, "2016-02-25T00:06:26+05:00", "Yup. Though truthfully, I'm not sure I understand what the problem is.")
  strzok_to_page(child_file, "2016-02-25T00:15:04+05:00", "Sorry still on phone. Issue is if Laufman makes himself one of the two DoJ, do i send the two case agents or insert myself. Andy told Bill send the best two. And what \"best\" means isn't clear to me in this context.")
  page_to_strzok(child_file, "2016-02-25T00:15:28+05:00", "Best means best. It's not a trick.")
  page_to_strzok(child_file, "2016-02-25T00:15:52+05:00", "If Laufman does that, then that's doj's loss. And I think warrants a call to his superiors.")
  strzok_to_page(child_file, "2016-02-25T01:00:20+05:00", "Hi. Just leaving. Trisha still there (or at least her car is). Saw --Redacted-- leaving, too, though he didn't see me --Redacted--")
  strzok_to_page(child_file, "2016-02-25T01:02:07+05:00", "We talked about it, but \"best\" was not in terms of agents (though that's what I wrote). It's about what the best outcome is. --Redacted--")
  page_to_strzok(child_file, "2016-02-25T02:20:31+05:00", "Do you or Bill fundamentally believe that 3 and 3 is the RIGHT thing for the case? If the answer is no, then you call --Redacted-- back and say we're good as is. You have never wavered from saying 2 and 2 is best. I don't get what the hesitation is now.")
  page_to_strzok(child_file, "2016-02-25T02:52:36+05:00", "One more thing: she might be our next president. The last thing you need is us going in there loaded for bear. You think she's going to remember or care that it was more doj than fbi?")
  strzok_to_page(child_file, "2016-02-25T02:56:28+05:00", "Agreed. I called Bill and relayed what we discussed. He agrees. I will email you and --Redacted-- same.")
  page_to_strzok(child_file, "2016-02-25T02:57:29+05:00", "Cool. You going to call back? I have one more thing to say, so long as you are out of earshot of folks.")
  strzok_to_page(child_file, "2016-02-25T15:14:23+05:00", "Sorry meeting went long with Bill. So --Redacted-- is covering 10 and my 11 just cancelled. --Redacted--")

  # OUTBOX is Page -> Strzok
  # INBOX is Strzok -> Page
  # Page 2  
  strzok_to_page(child_file, "2016-03-18T01:38:11+04:00", "Finally leaving. As I think about going away, I remember that we have moved around interviews so that I can be there for them. Those are the things I need to be present for.\n\nThe question remains whether I need to be here for this, or not need to, but should. --Redacted--")
  page_to_strzok(child_file, "2016-03-18T01:49:16+04:00", "Drive safely.\n\nThis case is fungible, possibly sooner than later. Your family is not. You need to go.")
  strzok_to_page(child_file, "2016-03-18T01:52:09+04:00", "Yeah, but you know what bugs me? If you weren't in there, who is supposed to point out all the doubts and qualifications about the repoting, all the potential misinterpretations and exaggerations? that person needs to be in the room. I understand it could be you, but it could be me or somebody else at that level. They should have the benefit of that type of nuance and information, and clearly they don't, or at least they don't enough. They're certainly not getting it out of the so-called senior leaders who are sitting around that table beside Andy.")
  page_to_strzok(child_file, "2016-03-18T02:05:04+04:00", "Jim does nuance. I'm not the only one in the room.")
  strzok_to_page(child_file, "2016-03-18T02:16:17+04:00", "But Jim doesn't get the reporting, does he? Saying hey this isn't a raw cut, all the opportunities for error/exaggeration?")
  strzok_to_page(child_file, "2016-03-18T11:31:26+04:00", "Thought of the perfect person D can bounce this off of")
  page_to_strzok(child_file, "2016-03-18T11:31:55+04:00", "Who?")
  m = strzok_to_page(child_file, "2016-03-18T11:37:51+04:00", "Pat\n\nYou gotta give me credit if we go with him.\n\nAnd delay briefing him on until I can get back and do it. Late next week or later.")
  m.addnote("Pat is Patrick Fitzgerald") 
  page_to_strzok(child_file, "2016-03-18T11:38:49+04:00", "We talked about him last night, not for this, but how great he is. He's in private practice though, right? Suppose you could still bring him back. And yes, I'll hold.")
  strzok_to_page(child_file, "2016-03-18T11:57:54+04:00", "Yes, he's at Skadden in Chicago. I haven't talked to him for a year or two. Don't forget that Dag Comey appointed him as special counsel in the Plame matter, and that he was there for Comey's investiture.") 
  strzok_to_page(child_file, "2016-03-18T11:58:33+04:00", "I could work with him again \u263a\n\nAnd damn we'd get sh*t DONE") 
  page_to_strzok(child_file, "2016-03-18T11:58:39+04:00", "I know. Like I said, we discussed boss and him yesterday.")
  strzok_to_page(child_file, "2016-03-18T12:05:54+04:00", "And it frustrates me, because Bill, at his 7:15, brings up the whole matter in front of his DADs. One who is acting for Dina. Who immediately goes to John and tell him how Bill is stressed because all the stuff is going on about a special prosecutor. Bill needs to learn to not talk to everybody about this when he's upset about it. And I guarantee that agent, while discreet, is certainly going to tell at least a few other people.\U0001f621\U0001f621\U0001f621\U0001f621\U0001f621\U0001f621") 

  # OUTBOX is Page -> Strzok
  # INBOX is Strzok -> Page
  # Page 3  
  m = strzok_to_page(child_file, "2016-03-18T12:06:06+04:00", "I'm sending --Redacted-- to the 8:30 with Jones so that I can meet with John.") 
  m.addnote("Jones is probably Bob Jones, Strzok's boss")
  page_to_strzok(child_file, "2016-03-18T12:46:19+04:00", "Did he go so far as to talk about why we started talking special prosecutor?!")
  strzok_to_page(child_file, "2016-03-18T12:47:24+04:00", "Don't think so. In my office talking to Jon") 
  page_to_strzok(child_file, "2016-03-18T16:32:08+04:00", "--Redacted--")
  strzok_to_page(child_file, "2016-03-18T16:32:45+04:00", "K. I'm waiting on --Redacted-- ...\U0001f612") 
  page_to_strzok(child_file, "2016-03-18T21:13:53+04:00", "If door is closed, probably okay to knock if his secretary is gone.")
  strzok_to_page(child_file, "2016-03-18T21:14:36+04:00", "Ok. You sure? And if she is, I'll just hang...") 
  page_to_strzok(child_file, "2016-03-18T21:16:19+04:00", "She leaves at 530. I just asked. Jim behind closed doors with Trisha now, so I'm waiting. \U0001f612")
  strzok_to_page(child_file, "2016-03-18T21:18:08+04:00", "Is it going to be weird if I show up, given Trishas email to you last night?") 
  strzok_to_page(child_file, "2016-03-18T21:18:27+04:00", "And let me know when you go in, I'll wait 10 then walk up") 
  m = page_to_strzok(child_file, "2016-03-18T21:18:39+04:00", "Yes, but remember, you're here to back brief on touhy.")
  m.addnote("touhy - Subpart B of Part 16 of Title 28, Code of Federal Regulations, sometimes referred to as the Department’s Touhy regulations. Former employees cannot produce records without prior permission.")
  strzok_to_page(child_file, "2016-03-18T21:19:02+04:00", "Totally got it") 
  page_to_strzok(child_file, "2016-03-18T21:19:16+04:00", "I'm going in now.")
  page_to_strzok(child_file, "2016-03-18T21:21:16+04:00", "Come soon")
  strzok_to_page(child_file, "2016-03-18T21:22:38+04:00", "30 sec out") 
  strzok_to_page(child_file, "2016-03-18T21:31:31+04:00", "Hit me before you go, obviously. And J*sus how embarrassing I can't believe how out of breath I was. \U0001f628") 
  strzok_to_page(child_file, "2016-03-18T21:31:45+04:00", "I mean that was weird....") 
  strzok_to_page(child_file, "2016-03-18T21:56:57+04:00", "Hey, do you know if you're close?") 
  page_to_strzok(child_file, "2016-03-18T21:57:39+04:00", "Walking to my ofc now")
  page_to_strzok(child_file, "2016-03-18T21:57:59+04:00", "You didn't need to run!")
  strzok_to_page(child_file, "2016-03-18T21:58:38+04:00", "You said come soon!\n\nI was mortified!") 
  page_to_strzok(child_file, "2016-03-18T21:59:01+04:00", "It wasn't that bad.")
  page_to_strzok(child_file, "2016-03-18T21:59:14+04:00", "Soon, now now! Or immediately!")
  strzok_to_page(child_file, "2016-03-18T21:59:59+04:00", "Ha. I AM responsive.")

  # OUTBOX is Page -> Strzok
  # INBOX is Strzok -> Page
  # Page 4 - DOJ-PROD-0000127 Page 35
  page_to_strzok(child_file, "2016-05-12T13:38:09+04:00", "Want me to come straight there?")
  m = page_to_strzok(child_file, "2016-05-12T16:07:24+04:00", "Hey need to go meet with NCOS on the uco stuff, --Redacted--")
  m.addnote("NCOS - National Covert Operations Section, uco - Undercover Operation")
  strzok_to_page(child_file, "2016-05-12T16:10:02+04:00", "Updates for you")
  strzok_to_page(child_file, "2016-05-12T16:15:35+04:00", "Will be in my office (just above you, I think) - sending UC to 1:00 so I have a bit more flexibility")
  strzok_to_page(child_file, "2016-05-12T20:57:57+04:00", "Hi. --Redacted-- coming through")
  page_to_strzok(child_file, "2016-05-12T21:03:50+04:00", "With what?")
  m = strzok_to_page(child_file, "2016-05-12T21:05:48+04:00", "Sitting in CES with them overnight writing the PSEU form so it's ready tomorrow morning for Dana and George to sign. Dana is ready.")
  m.addnote("PSEU - Policy and Statutory Enforcement Unit")
  page_to_strzok(child_file, "2016-05-12T21:08:34+04:00", "Good. F-ing finally.")
  page_to_strzok(child_file, "2016-05-12T22:28:44+04:00", "Holy cow are you still talking?!")
  strzok_to_page(child_file, "2016-05-12T22:46:24+04:00", "Just finished. Will call. On the way out Eric asked (he suggested no) if we needed the meeting tomorrow afternoon")
  page_to_strzok(child_file, "2016-05-12T22:48:06+04:00", "Did you ask Andy if he still wanted to meet tomorrow?")
  strzok_to_page(child_file, "2016-05-12T22:49:41+04:00", "I did not. I had left when Eric caught me. I told Eric I deferred to Andy about whether or not we needed to meet. We did not talk about what we planned to tell the D on Mon.")
  m = strzok_to_page(child_file, "2016-05-12T23:39:39+04:00", "Spoke to --Redacted-- and relayed Andy's message. Told him Andy was relaying to Carlin. Richard said he'd wait to hear from on high. Carlin and George are definitely going to have to message down")
  m.addnote("Carlin - John Carlin, head of DOJ’s national security division")
  page_to_strzok(child_file, "2016-05-12T23:50:01+04:00", "Can I send that to Andy.")
  m = strzok_to_page(child_file, "2016-05-12T23:53:23+04:00", "Think I need an eras....")
  m.addnote("eras - Enterprise Remote Access System")
  strzok_to_page(child_file, "2016-05-12T23:54:25+04:00", "And just got a mtg cancel for mtg tomorrow afternoon with Andy")
  strzok_to_page(child_file, "2016-05-12T23:59:27+04:00", "Remind me --Redacted-- story")
  m = page_to_strzok(child_file, "2016-05-13T00:00:36+04:00", "Yup. And Eric cancelling cve mtg too.")
  m.addnote("cve might be Countering Violent Extremism")
  page_to_strzok(child_file, "2016-05-13T00:01:11+04:00", "Tried --Redacted-- tonight but didn't reach him. Will try in am.")
  page_to_strzok(child_file, "2016-05-13T00:24:35+04:00", "Hey forgot to ask if you mentioned the whole special counsel thing to andy?")
  
  # Page 5 was transcribed elsewhere

  # OUTBOX is Page -> Strzok
  # INBOX is Strzok -> Page
  # Page 6 - DOJ-PROD-0000102 Page 10
  strzok_to_page(child_file, "2016-04-10T02:09:14+04:00", "Because you know where I was on Thursday or Friday night - when I was complaining about everyone expecting me to deliver the hard message while they vacillated in discussing with their counterparts. About how my sense of justness and character was at odds with waiting until Sat to say something.\n\nAnd rightfully, you point out stop being so prima donna-ish and just do it.\n\nAnd i do.\n\nAnd then I find out an hour later that in addition to what I was asked to do, JB went to counsel and had the discussion he did. And I'm the one facing the music. From some who I have known for a long time. Nobody else pays the price. Nobody else will have the same straight hard discussion. Yet I'm the only one who violated his sense of integrity to swallow hard and deliver the message.")
  strzok_to_page(child_file, "2016-04-10T02:09:52+04:00", "I'm not sure if I want to be part of this")
  page_to_strzok(child_file, "2016-04-10T05:51:15+04:00", "You are a part of this and that's not going to change. But I think you have every right to be angry and frustrated about being left out of the loop on your investigation, especially when you're going to be left holding the bag. And I think you're entitled to say something to Baker about that, though on this one I would probably discuss with Bill first.")
  page_to_strzok(child_file, "2016-04-10T05:52:00+04:00", "I'm sorry --Redacted-- Big big case, big big problems. But God knows you're still the right guy to do it.H1133")
  strzok_to_page(child_file, "2016-04-10T11:33:08+04:00", "Gmailed you two drafts of what I'm thinking of sending Bill, would appreciate your thoughts. Second (more recent) is updated so you can skip the first.")
  page_to_strzok(child_file, "2016-04-10T13:56:15+04:00", "Andy just called to make sure I had heard everything. Call when you're free.")
  strzok_to_page(child_file, "2016-04-10T15:52:27+04:00", "--Redacted-- Bill wants to talk to me at 1215...")
  strzok_to_page(child_file, "2016-04-10T22:19:37+04:00", "--Redacted-- Just talked with Bill, who spoke with everyone this morning. Will fill you in tonight or tomorrow.\n\nAlso, he was under the impression Andy wanted the meeting and a prebrief with FBI only just before. I think --Redacted-- may have screwed up that scheduling. Can you check? Obviously want to confirm with him before going to --Redacted--")
  strzok_to_page(child_file, "2016-04-10T22:19:40+04:00", "We talked for 45 minutes...")
  page_to_strzok(child_file, "2016-04-10T22:20:43+04:00", "Wow. Can you talk now?")
  page_to_strzok(child_file, "2016-04-10T23:00:05+04:00", "Sent email to andy re pre-brief. Will let you know what he says. Will wait to reach out to --Redacted-- re call-in line until I hear from him.")

  return None
  
