  strzok_to_page(child_file, "2015-12-29T14:03:50+05:00", "Truly, wouldn't worry too much about --Redacted-- involvement. A) she's in your chain of command (and I know attys are much more flat than agents about that) B) realistically not anything you're going to be able to do about it C) you're out of office without access to high side D) not hurting you (other than your ego). You're plenty talented. Everyone knows that. And you want to own your issue. Thats good and normal and everyone knows that, too.\n\nI know you know all this. Just trying to help you not let this be aggravating... \U0001f60a")
