  strzok_to_page(child_file, "2016-01-23T14:48:41+05:00", "Anyway. Terry McAuliffe just said VA is focusing on primary roads today and tomorrow and will try and get to secondary roads on Mon. What that means for tertiary roads like mine I have no idea.\n\nOh, btw, most of the Rep candidates still say it's not clear climate change is real.\U0001f612")
  strzok_to_page(child_file, "2016-01-24T21:38:51+05:00", "--Redacted-- My sense is stay in ogc. It's what Trisha wants - does JB has a preference? - and I'm guessing but not certain it will be easier from a HR Source admin perspective as well. And as long as they get plussed up fsl, they shouldn't care, right?")
  page_to_strzok(child_file, "2016-01-24T21:53:27+05:00", "No, you misunderstand. I got this email, muckities from other agencies were on it, as were Trisha and Jim, but couldn't decide whether to forward it and went back and forth bc I didn't want to step on toes or overstep if Jim had already forwarded, but Jim also isn't great at checking email over the weekend so I ended up text andy rather than just forwarding the email to him to ask whether he had received it or not. If I'm not in ogc, I don't think I'll have the same what's my role, am I overstepping stress. I just really want to be called his special counsel and not just special assistant, and I'm not sure Jim will let me.")
  strzok_to_page(child_file, "2016-01-24T21:57:26+05:00", "B) fortunately there will still be snow tomorrow.\nA) special counsel implies an ogc position, though, right? And would you get those emails if you weren't in OGC? Regardless, that worry about lane will resolve itself out once you get a chance to start working. One of those impossible to know now. But it will be fine. I promise.")
  strzok_to_page(child_file, "2016-01-24T21:59:19+05:00", "Is your title that big a deal to you at the end of the day? Not saying it shouldn't be, just trying to understand where it ranks within your priorities.")
  page_to_strzok(child_file, "2016-01-24T22:01:53+05:00", "I'm not sure I agree. If trisha's whole point of putting --Redacted-- there is to ensure more reliance on ogc, I'm not sure she's embrace me acting pretty independently, which is the only way I know how to be. Will forward a couple of emails - not a perfect example but maybe a little demonstrative. There are other \"special counsels\", the D's, one in OCA. I'm sure they're grandfathered, but I don't think Jim or especially trisha will want me to suggest I'm a lawyer if I'm not in ogc.")
  page_to_strzok(child_file, "2016-01-24T22:05:23+05:00", "Pretty important to me, actually. Especially if I plan to leave the bureau, I want my title to reflect the work I'm doing. Wtf is a special assistant to the private sector? Chief of staff would be fine, but 1) that's not the job I'll be doing and 2) Rybicki has made pretty clear he's opposed to me using that title. I'm a lawyer, it's my identity, it's what I'd like to call myself.")
  strzok_to_page(child_file, "2016-01-24T22:12:54+05:00", "Completely understand. So stay in OGC and be special counsel. Why does JB not want that? Particularly if that means they have some connection to your job? A lot of OGC are dummies but Jim and Trisha are not and you can work with both of them...")

