  strzok_to_page(child_file, "2016-02-03T01:29:11+05:00", "The problem with that is if whoever gets the tasking has questions, you want them to go to you. And if Trisha does that (cuts you out), it creates additional work for her to be the intermediary, right?\n\nAnd, F --Redacted--")
  page_to_strzok(child_file, "2016-02-03T01:45:19+05:00", "I really do hate him. Of course I'm swirling around and around and around in my head about what to do.")
  page_to_strzok(child_file, "2016-02-03T01:50:11+05:00", "I really truly hate --Redacted-- He is good at nothing, ineffective at nearly everything he does, and phenomenally lacking in self-awareness.")
  strzok_to_page(child_file, "2016-02-03T01:51:49+05:00", "I of course forgot it. Will need to ask when I'm not obviously on my phone. She didn't remember his last name...\n\nAnyway... --Redacted-- is an ahole. Always will be. There is literally nothing you can do to change him or his opinion. And people realize he's a d*ck - so it truly becomes an issue of judging someone by their enemies. While it may drive you CRAZY, may be best simply to rise above this (never forget it) and take the higher road")
  strzok_to_page(child_file, "2016-02-03T01:51:57+05:00", "Agreed. So why do you give him any power over_you?")
  page_to_strzok(child_file, "2016-02-03T01:55:16+05:00", "Honest to god, I'm not this time. F him. The Deputy Director picked ME to work for him, and I goddamn earned it, and he will never be asked to manage anything important for the rest of his career at the FBI. The swirl is whether to say anything to trisha. Of course now I'm leaning back toward no...")
  m = page_to_strzok(child_file, "2016-02-03T02:01:04+05:00", "Good summary of --Redacted-- Not sure why they leave Snowden entirely out of it, but that's why that DB max schrems sued...")
  m.addnote("DB is douche bag")
  strzok_to_page(child_file, "2016-02-03T02:02:21+05:00", "Lisa, that's all true. And if you want to rub his nose in it and destroy him, you can. This is not the moment. But honest to God I think that's the wrong choice.\n\nWhy do you think he's such a little prick? Exactly BECAUSE he will never be asked to manage anything important at the FBI. Feel sorry for him, not angry at him. He is displaying HIS weakness, his flaws, his shortcomings. Nothing else. Float past it unperturbed like the all star you are. Success is the best revenge.")
  strzok_to_page(child_file, "2016-02-03T02:06:48+05:00", "And --Redacted-- the higher you are, the more visible. The greater the number of fans. And the greater number of dB haters. This is a good baptism by fire. Because he's such an ass, hopefully it's easier to move past. If the thought of him gets you down, then think of the response you got from --Redacted-- and Randy and John and Andy. He will never get that. Ever.")
  page_to_strzok(child_file, "2016-02-03T02:07:54+05:00", "I know. I know, I know, I know. \U0001f636")

  # Page 172
  # Labelled DOJ-PROD-0000054 page 12
  # OUTBOX == Page
  # INBOX == Strzok
  page_to_strzok(child_file, "2016-02-03T02:10:09+05:00", "Okay. I'm not going to say anything. I know this is going to spin out of control (I'd bet any amount of money that he is going to tell KDM, who is going to feel obligated to say something to trisha, who I hope and pray will have my back and not assume I've done something to bring it on myself).")
  page_to_strzok(child_file, "2016-02-03T02:10:53+05:00", "God, it's very hard for me not to want to get in front of this.")
  strzok_to_page(child_file, "2016-02-03T02:14:35+05:00", "Trisha knows you are imminently capable. She knows he's a d*ck. It will be ok.")
  page_to_strzok(child_file, "2016-02-03T02:16:12+05:00", "Yes, but my reputation is that I have \"sharp elbows.\" So yes, I'm capable, but she doesn't necessarily know whether I played a role in this going south.")
  strzok_to_page(child_file, "2016-02-03T02:17:10+05:00", "One data point. She will have a thousand. And she already has many with you.\U0001f636\U0001f636\U0001f636")
  strzok_to_page(child_file, "2016-02-03T02:17:47+05:00", "Kill him with kindness. You have far, far - wildly so - more power.")
  strzok_to_page(child_file, "2016-02-03T02:17:58+05:00", "Why does HE bother you so?")
  page_to_strzok(child_file, "2016-02-03T02:23:07+05:00", "They all do. It's not just him. Honestly, because I'm painted unfairly. And I KNOW it's because of jealousy and I KNOW there's nothing I can do about it. But my sense of fairness is as foundational a part of me as literally any single trait I can think of. It's why I'm in government, why public service is a calling for me. So I think it is just very hard for me to let go when something is unfair.")
  strzok_to_page(child_file, "2016-02-03T02:52:37+05:00", "Yeah there's no good answer to the fairness thing.\n\nI lovehate him. I get it.")
  strzok_to_page(child_file, "2016-02-03T02:52:59+05:00", "Well, mostly hate. Shame\U0001f61e")
  strzok_to_page(child_file, "2016-02-03T12:24:26+05:00", "That sucks. I'm sorry. How are you feeling about --Redacted-- after a night of admittedly poor sleep?")
  page_to_strzok(child_file, "2016-02-03T12:48:07+05:00", "I don't know. Whatever. Angry. Resolved to leave ogc after this. Probably not going to say anything and will just steam inside instead.")
  strzok_to_page(child_file, "2016-02-03T12:55:42+05:00", "Well at a minimum, I think you should talk to Jason. Even if it doesn't change anything decision wise, it's another voice to confirm that you're doing the right thing, even if that's not particularly satisfying.")
  m = strzok_to_page(child_file, "2016-02-04T00:37:26+05:00", "Just had a great convo with one of the two new agents that the section picked up today. I knew her from WFO, public corruption agent. She's very excited and told me that she wouldn't let me down and that I wouldn't regret it. So that makes me happy.\U0001f60a")
  m.addnote("WFO is FBI Washington Field Office")
  m = page_to_strzok(child_file, "2016-02-04T00:46:23+05:00", "Picked up as an ssa?")
