  page_to_strzok(child_file, "2016-03-29T00:45:53+04:00", "No, not when it comes to someone's fundamental nature I didn't. --Redacted--")
  page_to_strzok(child_file, "2016-03-29T00:46:22+04:00", "--Redacted--")
  strzok_to_page(child_file, "2016-03-29T00:49:34+04:00", "Look. I think he very much believes in equity and fairness (notice in didn't say kindness - that may be, but i dont know him that well). I think he has a fundamental mistrust of headquarters. DOJ, mainly, but FBI too. I think he can be arrogant and doesn't like being disagreed with until he's measured you up and decided he's OK with you. That may make him arrogant, or rebellious. But I don't think it makes him an asshole.")
  strzok_to_page(child_file, "2016-03-29T00:50:02+04:00", "And no. I guess I don't like assholes. And I don't think he's one.")
