  strzok_to_page(child_file, "2016-03-29T00:52:56+04:00", "--Redacted-- Can someone who believes in equity and fairness be an asshole?")
  page_to_strzok(child_file, "2016-03-29T00:54:54+04:00", "Yes, of course! Someone is weak, insecure, threatened, whatever, and act like an asshole as a defense mechanism. I'm just telling you, everything about him, from jump, read that way to me. Even his posture was agressive, like he couldn't believe he had to justify himself again.")
  page_to_strzok(child_file, "2016-03-29T00:55:05+04:00", "You did. And they will.")
  strzok_to_page(child_file, "2016-03-29T00:57:00+04:00", "Well I like him, as far as I can tell. I'm not going to argue any more whether or not he's an asshole.")
  page_to_strzok(child_file, "2016-03-29T00:57:18+04:00", "Deal.")
