  page_to_strzok(child_file, "2016-03-30T01:38:51+04:00", "How about he just explain the intricacies to the group of people at the table who inquired of him in the first place?\n\nOn this guy? Don't waste your f-cking breath.")
  page_to_strzok(child_file, "2016-03-30T01:40:22+04:00", "I know he's wrong about me. I don't need his validation to know I'm good at what I do. I'm not interested in engaging in a dick measuring contest thanks.")
  page_to_strzok(child_file, "2016-03-30T01:40:46+04:00", "Yes, poor --Redacted-- He knows all the answers. If only everyone would just do as he said.")
  m = strzok_to_page(child_file, "2016-03-30T01:41:11+04:00", "Please - if you got summoned from Trenton to appear before the US Atty or the new Head of OCRS, you'd feel the same contempt. \"The suits at main (/front office) have never done it, have no idea what it really takes.\" It's the same for him.")
  m.addnote("OCRS is FBI Organized Crime and Racketeering Section of the Criminal Division")
  page_to_strzok(child_file, "2016-03-30T01:43:37+04:00", "But you've said I've done it. Apparently your word doesn't carry much weight either.\n\nAnd yes, you have the luxury, like all prosecutors, of being myopic about everything about the case in front of you. We have an institution to protect. Go fuck yourself, --Redacted--")
  page_to_strzok(child_file, "2016-03-30T01:48:32+04:00", "And franlkly, it shows how much weight he gives your opinion too. She's competent and has character and knows what she's talking about gets met with I can explain to her the intricacies of privileges she has never actually litigated. Quite the charmer.")
  strzok_to_page(child_file, "2016-03-30T01:49:24+04:00", "Stop!\nA) you want his validation, because if he's half of what he says, he's a good prosecutor. I want his validation.\nA) 1) he doesn't know you\nB) put yourself in his shoes. He's an AUSA in Richmond. He's not the AAG, or DMG, even though he's wildly more qualified. That gives rise to a complicated mix of contempt and envy and impatience and disrespect.\nC) he's had to fight harder than he should for justice (sound familiar?). That breeds distrust of authority.\nD) you're welcome re my defense. Even though he isn't willing to drop decades of experience for an acquaintance he's had for 6 months, I hope I'm and trust it counts for something.")
  strzok_to_page(child_file, "2016-03-30T01:51:14+04:00", "And dammit maybe people's opinions aren't perfect but are shaped by their insecurities. Where does your expectation of perfect people come from? Good people can be limited by their. flaws.\n\nAnd their flawed opinion of you doesn't make it true (about you).")

  # Page 208
  # Labelled DOJ-PROD-0000090 page 48
  # OUTBOX == Page
  # INBOX == Strzok
  page_to_strzok(child_file, "2016-03-30T02:00:38+04:00", "I have zero confidence at this time that he is a good prosecutor. Lots of inflated ego blowhards actually think they are, doesn't make it so. Pony up a comprehensive memo on work product, teach us all what we don't I know, and I'd be happy to change my opinion.\n\nYou want everyone's I validation.\n\nI do appreciate your defense of me. I should have thanked you earlier. Thank you.\n\nI do not believe that I am perfect, nor do I expect others to be - that's entirely unfair.")
  strzok_to_page(child_file, "2016-03-30T02:02:48+04:00", "A) he convicted MacDonald. I don't know the rest of his trial record but I know he has a great reputation\nB) I do. It's a fault of mine. I'm working on it.\nC) always. \U0001f636")
  strzok_to_page(child_file, "2016-03-30T02:03:14+04:00", "D) you misunderstand me. I'm saying HE'S imperfect")
  page_to_strzok(child_file, "2016-03-30T02:03:24+04:00", "I haven't seen a whole lot of \"doing\" from him. But I've certainly heard a whole lot of talk. He's litigated it 7000 times, should be no problem to explain the law then. Hell, he can pull it out of the 7000 filings he's had to make on the topic.")
  page_to_strzok(child_file, "2016-03-30T02:03:51+04:00", "D) I'm not looking for perfect from anyone. What I'm looking is humility.")
  strzok_to_page(child_file, "2016-03-30T02:04:14+04:00", "D) consequently his beliefs and impulses and reactions (to you, in this specific instance) are fkawed.")
  page_to_strzok(child_file, "2016-03-30T02:04:32+04:00", "A) And that's legit. And from everything I. know, a tough case. So kudos to him. Doesn't change the rest of it.")
  strzok_to_page(child_file, "2016-03-30T02:05:31+04:00", "A) bullshit of course it does. There is work behind that success. And unlike the --Redacted-- poseurs, --Redacted-- actually did the lift.")
  page_to_strzok(child_file, "2016-03-30T02:06:15+04:00", "I know they are. I do not take the comments of someone who has known me for a grand total of one hour to heart. I'm a lot more confident than that. You don't have to believe me, but I'm not looking for his validation. I'd simply take not being prejudiced and just a *smidge* less arrogance.")
  strzok_to_page(child_file, "2016-03-30T02:06:15+04:00", "Who amongst us is humble? Andy? You? Me? Let's be brutally honest.")
  page_to_strzok(child_file, "2016-03-30T02:06:33+04:00", "A) I believe that! I meant that that was impressive!")
  strzok_to_page(child_file, "2016-03-30T02:06:59+04:00", "And I'm telling you it's wrong to read it as arrogance.")
  page_to_strzok(child_file, "2016-03-30T02:07:11+04:00", "Oh stop with the philosophical discussion. No. But do we make a point of rubbing everyone's nose in it?")
  page_to_strzok(child_file, "2016-03-30T02:07:26+04:00", "Then me,--Redacted-- and Andy are all wrong. So be it.")
  strzok_to_page(child_file, "2016-03-30T02:07:30+04:00", "I'd say - reduced to its core - it's inferiority and contempt and doubt.")
  m = strzok_to_page(child_file, "2016-03-30T02:09:11+04:00", "Jesus. You're not all wrong. His assumption is you are Giuliano and --Redacted-- and Giacalone. --Redacted-- Lisa Monaco. Same-same. Why should he trust this is any different.\n\n\nWhy are you responding so damn hard?!?!?")
  m.addnote("Giacalone is John Giacalone FBI Assistant Director of Counterterrorism Division")
  page_to_strzok(child_file, "2016-03-30T02:09:39+04:00", "Which I dislike even more. It's the very trait I most loathe. Instead of a modicum of humility, self-awareness, men in particular self-aggrandize to make up for their own inferiority.")

