  # Labelled DOJ-PROD-0000091 page 49
  # OUTBOX == Page
  # INBOX == Strzok
  strzok_to_page(child_file, "2016-03-30T02:10:26+04:00", "And same question you're not arrogant? Andy's not? I'm not? The Director?\n\nThe only person I can honestly say no to is --Redacted--")
  page_to_strzok(child_file, "2016-03-30T02:12:33+04:00", "Am I confident in my abilities? Yes. Do I have to cut people down or rub someone's nose in it to prove it to them, myself, or to feel good about myself? No I do not.")
  strzok_to_page(child_file, "2016-03-30T02:12:47+04:00", "I don't think he's self-aggrandizing. I think he's earned his chops and is engaging in behavior to minimize the devastating past impact of politically motivated assholes torpedoing justice for their own advancement. There's a difference.")
  strzok_to_page(child_file, "2016-03-30T02:14:17+04:00", "He didn't cut you down! He didn't say anything until prompted by me. And his (misinformed - wrong in this instance but usually right) opinion was informed by repetitive past experience.")
  page_to_strzok(child_file, "2016-03-30T02:14:34+04:00", "So show me the fight for justice in this case. Not just the sweet nothings he whispers in your ear alone, but the truth to power that he's speaking every day.")
  strzok_to_page(child_file, "2016-03-30T02:16:04+04:00", "After he's been told by George and --Redacted-- to --Redacted-- that their job is to get process? That they are to be seen but not heard, like children? Why on earth would he be cynical?")
  strzok_to_page(child_file, "2016-03-30T02:18:30+04:00", "And the fact that you don't need to cut people down or run their nose in it doesn't diminish my point. Most people are flawed. See past their problems - those problems are theirs, not yours - to let you see the good and noble in them.")
  strzok_to_page(child_file, "2016-03-30T02:26:07+04:00", "I guess I'd say assume good intent. Whatever the pitfalls, assume good intent.")
  strzok_to_page(child_file, "2016-03-30T12:17:28+04:00", "Hi. 830 with Jones cancelled")
  strzok_to_page(child_file, "2016-03-30T19:33:07+04:00", "Yep. But I don't know her schedule. She was talking desk search policy change with Trisha at 3 then calling Fort now.")
  strzok_to_page(child_file, "2016-03-30T22:12:43+04:00", "Need to talk later just got pulled into briefing tomorrow with ces, toscas, --Redacted-- briefing chief of crim div on internal.")
  page_to_strzok(child_file, "2016-03-31T00:07:09+04:00", "Hey, was thinking, don't you think DD should get a brief on that case for tomorrow before doj does? Or at least at about the same time? Maybe mention to bill?")
  strzok_to_page(child_file, "2016-03-31T00:10:35+04:00", "Briefed Bill, he intended to tell Mike to brief Andy. Gave him enough copies.")
