  strzok_to_page(child_file, "2016-10-24T00:26:14+04:00", "It hasn't hit Google yet! I'll send it when it happens. Maybe 5 min, maybe 2 hours.\n\nBut the article was up a good 30 minutes before you told me.\n\nAre you upset because you thinks this points to you? Because if I waited (20 minutes 2 hours whatever) time it would be OK?\n\nWhatis it that's making you so angry? Because I simply don't get it.")
  page_to_strzok(child_file, "2016-10-24T00:27:59+04:00", "Yeah, and I told you a grand total of 2 minutes after I learned it was up from andy. And you sent it 5 minutes after that. And if you actually read your texts instead of desperately trying to be first, you'll see that us said no, I don't think you should send it.")
