  strzok_to_page(child_file, "2017-05-24T00:40:49+04:00", "Make sure you're weighting all your considerations honestly and appropriately. You said tonight you want to stay and protect the FBI. Is that true, or is it really stay and protect Andy? What if it's Director Townsend? Staying for Andy is perfectly fine. Just be brutally honest with yourself.")
  strzok_to_page(child_file, "2017-05-24T00:42:23+04:00", "I don't know what I want, Lisa. I don't want to be anything but the lead agent. And I think that is going to be a far cry from the inner sanctum of what Bob decides. I don't think agents will play a significant role. I (or whoever) might work into that circle of trust, but he's not going to view the lead agent the same as aaron")
  page_to_strzok(child_file, "2017-05-24T00:43:26+04:00", "No, but Aaron might, which would be as good as Bob doing it.")
