  page_to_strzok(child_file, "2017-05-31T00:38:22+04:00", "You going to give az a heads up tonight?")
  m = strzok_to_page(child_file, "2017-05-31T00:43:50+04:00", "Oh, he was there. Standby on imsg")
  m.tag("iMessage", "Strzok and Page used private iPhones to communicate without leaving evidence", truxton.TAG_ORIGIN_HUMAN)
  m.addnote("Strzok and Page used private iPhones to communicate without leaving evidence")
  page_to_strzok(child_file, "2017-05-31T03:10:00+04:00", "Asked me at the end whether I would be willing to serve in a similar role as I have for Andy. It frankly makes more sense than conf. affairs. Let's talk through. Also, please clear.")
  page_to_strzok(child_file, "2017-06-01T00:53:04+04:00", "Btw andy called me earlier but I was at --Redacted-- and couldn't talk. Our plan is to talk tomorrow. Good sign that he is reaching out I think.")
  strzok_to_page(child_file, "2017-06-01T01:06:05+04:00", "Gosh I hope so. I was having some regret that I didn't tell him what I was currently thinking")
  page_to_strzok(child_file, "2017-06-01T01:09:41+04:00", "I'm sure he's calling to follow up from my text yesterday in light of Bob's call today.\n\nTo be clear, if he asks about you I'm going to say you're always a benefit to the team, but that the team will be okay without you.")
  strzok_to_page(child_file, "2017-06-01T01:15:14+04:00", "Is that the right answer re me? It may be true, but I'm reassessing what the hell I want right now. I don't have a great feeling about the big bureau right now and my role (and others perception of that) in it, and the SC seems like a tangible, worthwhile effort to do before I retire.")
  strzok_to_page(child_file, "2017-06-01T01:16:50+04:00", "What do you think I should do?")
  page_to_strzok(child_file, "2017-06-01T01:19:30+04:00", "I think you should stay the course. But I will talk to Andy honestly about --Redacted-- and future and all that.")

  # Page 466
  # OUTBOX == Page
  # INBOX == Strzok
  m = strzok_to_page(child_file, "2017-06-01T01:23:35+04:00", "Is Andy truly accepting of the fact of the potential limitations that he may not be DD as long as he thought, and regardless, that we'll have a new D, as all this unfolds?\n\nBtw, Bill said he heard some guy in INSD was ranked #2 for the job. Someone we interviewed of a SC job in CD and turned down. Truly I don't know wtf is going on. Do I have cognitive dissonance?")
  m.addnote("CD - FBI Counterintelligence Division")
  m = strzok_to_page(child_file, "2017-06-01T01:44:36+04:00", "Look, here's the bottom line as best as I can sum up (and I hope you already know all this)\n\n- I don't think Andy's acting in bad faith. I do think what he hypothetically proposes isn't something in his thought process or skillset or his available time and ability. In other words, when JG or Randy or even Bob said they had a plan, they had a PLAN. I don't think Andy does. And as A/D that's something too small for him to worry about. To put a fine point on in --Redacted-- Wtf. Such a pin to the balloon of faith and confidence in the system.\n\n- I knew my standing with Comey and Andy. One is gone, the other uncertain at best.\n\n- I don't trust/believe in my standing with Dave and Carl and the rest of the EADs.\n\n- the SC is straightforward and rewarding, meaningful, honorable and a known quantity. It would cement my image as the \"special project guy\" or \"glorified case agent\" (nevermind they'll never see --Redated-- that way for doing the same job less well). I guess I'm feeling like I don't care about that right now. But it's not like i have a long time left.")
  m.addnote("EAD - Executive Assistant Director")
  page_to_strzok(child_file, "2017-06-01T02:05:56+04:00", "I understand all this. So what do you want me to say to him? Can I lay out this thinking, attributes to me?")
  strzok_to_page(child_file, "2017-06-01T02:20:26+04:00", "I don't know.\n\nMaybe i should sleep on it.\n\nMaybe, Pete's uncertain, between Comey the --Redacted-- he's reassessing if he should just go?\n\nI don't know, Lis.")
  page_to_strzok(child_file, "2017-06-01T02:25:27+04:00", "We can talk in the morning.")
  page_to_strzok(child_file, "2017-06-01T02:25:56+04:00", "But I think that's a perfectly reasonable way to approach it.")
  strzok_to_page(child_file, "2017-06-01T02:34:23+04:00", "Thank you \U0001f636")
  strzok_to_page(child_file, "2017-06-01T02:36:40+04:00", "Sorry I don't have a ready answer here. I feel strongly - if ambiguously - at the same time I want to represent myself at the same time I don't want to be \"that guy\"\n\nNone of us are owed anything. Except when I think of the last 18 months.\n\nAnd then I think several of us ARE owed something. --Redacted--")
  strzok_to_page(child_file, "2017-06-01T10:09:59+04:00", "Hi.\n\nThe only additional thought I had is it's not tenable to have both me and --Redacted--chere. If he's in charge and I'm around, it undermines him (because Mueller and Aaron will be looking to me), it puts me in a horrible position, and it's a waste of Bureau resources. I told Bill that, but in don't know that will get up from him thru Carl to Andy.")

  # Page 467
  # OUTBOX == Page
  # INBOX == Strzok
  page_to_strzok(child_file, "2017-06-01T10:14:34+04:00", "Yeah, I definitely plan to do that.")
  page_to_strzok(child_file, "2017-06-01T10:16:51+04:00", "I'm growing more doubtful about my role staying on. For the same reason you're not absolutely essential once 30 or 45 days is up, I'm not absolutely essential. You don't need someone to see around corners and check for pitfalls when you have the most all-star of all-star teams. I mean sure, might catch a ball or two? Maybe. But not like the value I add at HQ when it's mostly not all-stars.")
  strzok_to_page(child_file, "2017-06-01T10:16:59+04:00", "Thanks. Really curious to hear what he's thinking.")
  strzok_to_page(child_file, "2017-06-01T10:21:01+04:00", "I hear you. But a couple of things. First, I really truly believe you're not giving yourself enough credit for how good you are. Depends on what you want. At the Bu, you'll be a superstar amongst mostly not all-stars. There, you're a superstar amongst superstars.\n\nSecond, be really honest, what is your future at the Bureau? As long as Andy is A/D, you're in a weird place with JR and --Redacted-- I don't know what his future is when a D is confirmed. Nor do I know Bakers future. --Redacted-- And in terms of launching into the private sector, it's FAR more valuable.")
  strzok_to_page(child_file, "2017-06-01T10:22:01+04:00", "On the flip side, I probably wouldn't want to be --Redacted-- not with --Redacted--")
  page_to_strzok(child_file, "2017-06-01T10:22:03+04:00", "This is all true. But do I want this enough if my job is --Redacted--")
  strzok_to_page(child_file, "2017-06-01T10:22:21+04:00", "Jesus")
  page_to_strzok(child_file, "2017-06-01T10:23:20+04:00", "I honestly just don't see much of a role working for Bob/Aaron. They don't really need me. I'm happy to shag issues, but I don't really see that happening. Aaron doesn't give up much.")
  strzok_to_page(child_file, "2017-06-01T10:25:12+04:00", "That's definitely true re Aaron. I don't know if you'll be part of the true inner core, especially when they're fully staffed. Nor whoever the lead fbi person is.")
  page_to_strzok(child_file, "2017-06-01T10:25:50+04:00", "So then what am I doing there? Just padding my resume?")
  strzok_to_page(child_file, "2017-06-01T10:30:40+04:00", "Doing something meaningful, historic")
  strzok_to_page(child_file, "2017-06-01T10:31:15+04:00", "And yes, making contacts and superbly positioning yourself for whatever comes next")
  page_to_strzok(child_file, "2017-06-01T10:32:00+04:00", "Meh. Not if I'm the least impressive among the most impressive brains in America.")
  strzok_to_page(child_file, "2017-06-01T10:32:06+04:00", "Sorry was reading Carrie Johnson tweet and thread about Andrew being added to the team")
  page_to_strzok(child_file, "2017-06-01T10:32:44+04:00", "Send it please? He must have told her - they're close")
  strzok_to_page(child_file, "2017-06-01T10:33:55+04:00", "Lisa. I don't think that's true. You won't be least impressive. You (and/or i, if I go) will solidly hold our own. Thats more than enough for you when it's all done. And that group will forever take take of itself. Look at the Enron crew.")
  
