  strzok_to_page(child_file, "2017-06-02T00:41:10+04:00", "Yeah just talked to aaron, he relayed same. --Redacted-- is f*cking this ALL up. I think Paul A gets it and Andy's intent (or at least made statements to Carl about it in front of me), but word most certainly is not getting down the chain.\n\nYou've now GOTTA come to this sh*t show of a brief tomorrow.")
