  page_to_strzok(child_file, "2017-06-02T01:24:09+04:00", "Btw, I meant to point out to you today, you used the expression \"horse sense\" in reference to \"any agent's horse sense will tell them x...\" See? Horse sense. It's an expression for a reason... :)")
  strzok_to_page(child_file, "2017-06-02T01:25:02+04:00", "Ha. You're absolutely right. I had no notion of doing it when I did.")
  strzok_to_page(child_file, "2017-06-02T01:49:02+04:00", "Aaron said he was going to talk to Carl tomorrow. I told him that, --Redacted-- some call he had with --Redacted-- these are the 10-14 days of hurt feelings and tears. At the point of moving past nice, just saying how it is.")
  page_to_strzok(child_file, "2017-06-02T10:54:20+04:00", "Think we are having the 9:15 this am?")
  strzok_to_page(child_file, "2017-06-02T10:54:46+04:00", "We're not. Was going to ask if you want to walk over.")
  page_to_strzok(child_file, "2017-06-02T10:56:23+04:00", "Have to do the class review doc first.")
  strzok_to_page(child_file, "2017-06-02T13:37:36+04:00", "And I just picked up on what you said when you answered the phone. What were/are you talking about?")
