def add_durham_report(parent_file: truxton.TruxtonChildFileIO) -> None:
  child_file = add_file(parent_file, SUPPORT_DOCUMENTS_FOLDER + "durhamreport.pdf")
  
  # CHS-1 is Stefan Halper
  # UCE-2 is Azra Turk, UCE means FBI Undercover Employee
  # Foreign Government-1 Diplomat-1 is Christian Cantor, Political Counselor at the Embassy of Israel in London
  # Australian Diplomat-1 is Erika Thompson, Assistant to High Commissioner Alexander Downer in London and Christian Cantor's fiance
  # Supervisory Special Agent-1 is Pientka

  url = child_file.newurl()
  url.url = "https://www.justice.gov/archives/sco-durham/media/1381211/dl"
  url.localfilename = "durhamreport.pdf"
  url.type = truxton.URL_TYPE_FIREFOX
  url.method = truxton.URL_METHOD_TYPE_CLICKED_ON_A_LINK
  url.format = truxton.URL_FORMAT_ASCII
  url.when = datetime.fromisoformat("2025-01-01T00:00:00+05:00")
  url.save()
  
  location = child_file.newlocation()
  location.type = truxton.LOCATION_TYPE_HOME
  location.label = "FBI Washington Field Office - 601 4th Street NW"
  location.latitude = 38.8977186964291
  location.longitude = -77.01560369926702
  location.when = datetime.fromisoformat("2016-01-01T12:00:00+05:00")
  location.save()
  
  add_event( child_file, "2016-05-06T12:00:00+04:00", "2016-05-06T12:05:00+04:00", "Christian Cantor introduces Papadopoulos to Erika Thompson", "Durham Report page 61", EVENT_TYPE_CAMPAIGN )
  add_event( child_file, "2016-09-25T12:00:00+04:00", "2016-09-25T12:05:00+04:00", "Carter Page writes a letter to Comey offering to be interviewed", "It was never acted upon. Durham Report page 67", EVENT_TYPE_CAMPAIGN )

  return None

